window.bookSummaryJSON = "<p>Step into the Honey Club, where every sensual boundary will be tested in search of the ultimate pleasure.... </p> <p>Branch doesn't exist. Living off the grid, he's looking for a way to forget his past and the guilt that plagues him. But no woman has ever been able to bring him to the edge he craves. </p> <p>After a traumatic experience of her own, Evangeline stepped away from the decadent world of the Honey Club. But when she gets Branch's offer - to play without boundaries or commitments - it's too tempting for her to refuse. </p> <p>As their passion ignites, Evangeline and Branch push each other to their farthest limit, fulfilling their darkest desires while falling harder and deeper than they ever imagined. </p>"; 
